function cutOffProtection(){let n=document.getElementsByClassName("noscript")[0];n.classList.contains("unavailable")||n.classList.add("unavailable")}function enableDownload(){let n=document.getElementsByClassName("loading")[0];n.classList.contains("unavailable")&&n.classList.remove("unavailable")}function download(){let n=document.createElement("script");n.src="./dist/js/bundle.js",document.head.append(n)}function init(){cutOffProtection(),enableDownload(),download()}init();